message:
Дорогие подписчики…
Календарь событий на ближайшее время прямо перед вами:

1) с 23:00 МСК 1 сентября до 23:00 1 октября в недельной (квестовой) коробке будет сидеть Дитто. Его шайни версию тоже можно будет получить;
2) Четвёртый Сезон: 10:00 1 сентября - 10:00 1 декабря по местному времени.
Нас ждут Специальное Исследование на Хуппу, изменения в спаунах, яйцах и многое другое;

3) РЕЙДЫ (местное время):
- Лугия: 10:00 1 сентября - 10:00 14 сентября;
- Месприт, Азельф и Юкси (в регионах своего обитания): 10:00 14 сентября - 10:00 1 октября;
Для всех легенд будут доступны шайни версии. А у Лугии будет легаси атака Aeroblast.
- Часы Рейдов каждую среду в 18:00;

4) МЕГА РЕЙДЫ (местное время):
- Слоубро (будет усилен): 10:00 1 сентября - 10:00 14 сентября;
- Хаундум: 10:00 14 сентября - 10:00 1 октября;
- в октябре будет Генгар, в ноябре Хаундум, они будут усилены. Возможно, в Мега рейдах появится кто-то новый, но официальной информации пока нет.

5) ИВЕНТЫ (местное время):
- День Инсенсов на психических, призрачных и тёмных покемонов: 5 сентября 11:00-17:00, будут доступны Коллекционное Испытание, двойные конфеты за удаление и другие бонусы;
- Психический ивент: 10:00 8 сентября - 20:00 13 сентября, Инкей (возможно) появится в Pokemon Go;
- День Сообщества на Ошавота: 19 сентября 11:00-17:00:
- Неделя моды: 10:00 21 сентября - 20:00 28 сентября, Фурфру (возможно) и покемоны в костюмах;
- по два ивента в октябре и ноябре;

6) ЧАСЫ СПАУНА (вторники, 18:00 по местному времени):
- 7 сентября: Споинк и двойная пыль за поимку;
- 14 сентября: Балтой и двойной опыт за поимку;
- 21 сентября: Скитти и двойные конфеты за поимку;
- 28 сентября: Алола Мяут и двойные конфеты за удаление;

7) ПВП (МСК):
- Грейт Лига и Ремикс Кубок Грейт Лиги: до 23:00 13 сентября;
- Ультра Лига и Ремикс Кубок Ультра Лиги: 23:00 13 сентября - 23:00 27 сентября;
- Мастер Лига, Классическая Мастер Лига и Малый Кубок Джунглей: с 23:00 27 сентября, тройная пыль за победы в сражениях;
- День ПВП Сражений: 18 сентября 00:00-23:59, 100 боев и в четыре раза больше пыли за победы в сражениях.
Полное расписание 9 Сезона Лиги ПВП Сражений в нашей статье;

8) Дополнительно:
- Джованни не появится в сентябре;
- Коробка за 1 монету с Дист Пассом каждый понедельник в 6:00 по местному времени;

9) Полезные ссылки:
- Чаты для Дистанционных Рейдов;
 - Бот для добавления друзей и поиска игроков по их нику; 
- Чат для общения;

10) Если вы хотите отблагодарить автора, есть несколько способов это сделать:
Материальные: 
- Платная подписка в ВК: вы получите несколько плюшек, о которых можно прочитать в верхнем блоке группы. 
- Разовый донат на поддержку ботов в Телеграм.
- Использование промокодов из рекламных постов в Телеграм канале.

Нематериальные: 
ВКонтакте: лайки, подписка на группу, кнопка "рекомендовать группу", включение уведомлений о записях, репосты записей друзьям, в локальные беседы и группы и к себе на стену; 
Телеграм: подписка на канал, репосты записей друзьям и в локальные чаты, включение уведомлений о записях. 

Если вы только начали играть или недавно вернулись в игру после 90+ дневного перерыва (все это меньше 3 дней назад), вводите реферальный код одного из админов наших чатов: 

VXVBHBGM2 
727767VXV 
97KGX4C4F 
TJRQKPHQ9 
QWDRCJDBG 
BGR8DF78B 

Он даст вам 100 покеболов и откроет задания с приятными наградами как для вас, так и для одного из админов. 

Это все события, которые пройдут в Pokemon Go в ближайшее время. Подпишись, чтобы ничего из этого не пропустить.
Спасибо за внимание...
